import React from 'react';
import banOne from '../assets/Images/Brew-Story/ban1.jpg';
import banTwo from '../src/assets/Images/Brew-Story/ban2.png';
import banThree from '../src/assets/Images/Brew-Story/ban3.png';
import banFour from '../src/assets/Images/Brew-Story/ban4.jpg';

function Header(props) {
  return (
    <div>
      <div id="carouselExampleAutoplaying" className="carousel slide" data-bs-ride="carousel">
        <div className="carousel-inner">
          <div className="carousel-item active">
            <img src={banOne} className="d-block w-100" alt="Banner 1" />
          </div>
          <div className="carousel-item">
            <img src="/src/assets/Images/Brew-Story/ban2.jpg" className="d-block w-100" alt="Banner 2" />
          </div>
          <div className="carousel-item">
            <img src="/src/assets/Images/Brew-Story/ban3.jpg" className="d-block w-100" alt="Banner 3" />
          </div>
          <div className="carousel-item">
            <img src="/src/assets/Images/Brew-Story/ban4.jpg" className="d-block w-100" alt="Banner 4" />
          </div>
        </div>
        <button className="carousel-control-prev" type="button" data-bs-target="#carouselExampleAutoplaying" data-bs-slide="prev">
          <span className="carousel-control-prev-icon" aria-hidden="true"></span>
          <span className="visually-hidden">Previous</span>
        </button>
        <button className="carousel-control-next" type="button" data-bs-target="#carouselExampleAutoplaying" data-bs-slide="next">
          <span className="carousel-control-next-icon" aria-hidden="true"></span>
          <span className="visually-hidden">Next</span>
        </button>
      </div>
    </div>
  );
}

export default Header;
